import './App.css';
import AboutUs from './components/AboutUs';
import Landing from './components/Landing';
import Navbar from './components/Navbar';
import ServiceSection from './components/ServiceSection';

function App() {
  return (
    <div className="App">
      <Navbar/>
      <Landing />
      <AboutUs />
    </div>
  );
}

export default App;
